import React from 'react';
import Slideshow from '../Slideshow/Slideshow'; // Make sure the path is correct
import './Projects.css'; // Make sure the path is correct

// Import your slide images
import hackathon1 from '../images/project_images/lyric_link.gif';
import hackathon2 from '../images/project_images/att_empowher.png';
import hackathon3 from '../images/project_images/datafest.png';

// Define your slides array
const hackathon_slides = [
  {
    image: hackathon1,
    captions: [
      { text: 'SacHacks', style: {} },
      { text: 'React', style: { backgroundColor: 'blue' } },
      { text: 'Django', style: { backgroundColor: 'blue' } }
    ]
  },
  {
    image: hackathon2,
    captions: [
      { text: 'AT&T: EmpowHer', style: { backgroundColor: '' } },
      { text: 'HTML', style: { backgroundColor: 'green' } },
      { text: 'CSS', style: { backgroundColor: 'green' } },
    ]
  },
  {
    image: hackathon3,
    captions: [
      { text: 'Datafest', style: {} },
      { text: 'Pandas', style: { backgroundColor: 'blue' } },
      { text: 'Python', style: { backgroundColor: 'green' } }
    ]
  }
  // Add other slides as needed
];

function Projects() {
  return (
    <div className="projects">
      <div className="projects__section">
        <div className="projects__slideshow-container">
          <Slideshow slides={hackathon_slides} />
        </div>
      </div>
    </div>
  );
}

export default Projects;
